import { createBrowserRouter } from 'react-router-dom';
import React from 'react';
import Contact from './sites/contact';
import App from './App';
import Pruning from './components/pruning';

const routes = createBrowserRouter([
  {
    path: '/',
    element: <App />,
  }, {
    path: '/pruning',
    element: <Pruning />,
  }, {
    path: '/contact',
    element: <Contact />,
  },
]);
export default routes;
